!function(e){try{e=angular.module("app")}catch(t){e=angular.module("app",[])}e.run(["$templateCache",function(e){e.put("/partials/calculator/calculator.view.html",'<div class="jumbotron"><h1><div ng-show="vm.resultScore"><div>{{vm.resultScore | score}}</div><p class="lead">\u5b9e\u9645\u5206\u6570: <strong>{{vm.resultScore}}</strong></p></div><div ng-hide="vm.resultScore">\u603b\u6210\u7ee9</div></h1><!--<p class="lead">\u901a\u8fc7\u586b\u5199\u542c/\u8bf4/\u8bfb/\u5199\u6210\u7ee9,\u5b9e\u65f6\u8ba1\u7b97\u51fa\u603b\u5206</p>--><!--<p><a class="btn btn-lg btn-success" href="#" role="button">Sign up today</a></p>--><div class="row marketing"><div class="col-lg-12"><div ng-repeat="item in vm.items.arr"><div class="input-group input-group-lg"><span class="input-group-addon">{{::item.name}}</span> <input type="number" min="0" max="9.0" step="0.5" class="form-control" placeholder="{{::item.placeholder}}" ng-model="item.score"></div><br></div></div><div class="col-lg-12"><button class="btn btn-lg btn-block btn-success" ng-disabled="!vm.isFullFilled" ng-click="vm.calculate()">\u8ba1\u7b97</button></div></div></div><div class="panel panel-default"><div class="panel-heading"><div class="panel-title">\u8bc4\u5206\u5bf9\u7167\u8868</div></div><div class="panel-body"><div class="row"><div class="col-md-4" ng-repeat="score in vm.scores"><h4>{{score.name}}</h4><table class="table table-striped table-bordered table-hover"><tr><th>\u6b63\u786e</th><th>\u5206\u6570</th></tr><tr ng-repeat="item in score.arr"><!--<td>--><!--<span ng-show="item.range.max-item.range.min > 0">--><!--{{::item.range.min}} - {{::item.range.max}}--><!--</span>--><!--<span ng-show="item.range.max-item.range.min == 0">--><!--{{::item.range.min}}--><!--</span>--><!--</td>--><td><span ng-repeat="val in vm.range(item.range.min, item.range.max)">{{val}} &nbsp;</span></td><td><strong>{{::item.score}}</strong></td></tr></table></div></div></div></div>')}])}(),function(e){try{e=angular.module("app")}catch(t){e=angular.module("app",[])}e.run(["$templateCache",function(e){e.put("/partials/listening/listening.view.html",'<div class="panel panel-default"><div class="panel-heading">\u542c\u5199\u5185\u5bb9</div><div class="panel-body monospaced"><div ng-repeat="item in vm.items" ng-class="{\'inline-block\': item.type !== \'lineBreak\'}" enter-as-tab data-type="{{item.type}}"><!--<div class="label label-default" ng-class="{\'label-info\': item.type == \'word\'}">{{item.val}}</div>--> <input class="input-word" type="{{item.type == \'word\' ? \'text\' : \'hidden\'}}" size="{{item.val.length}}" ng-model="item.input" ng-class="{\'input-ok\': item.input == item.val}"> <span ng-show="item.type == \'punctuation\'">{{item.val}}</span></div></div></div><div class="panel panel-default"><div class="panel-heading">\u8bbe\u7f6e\u8981\u542c\u5199\u7684\u5185\u5bb9</div><div class="panel-body"><p ng-show="vm.isShowContent"><textarea class="form-control" cols="30" rows="10" placeholder="\u542c\u5199\u5185\u5bb9" ng-model="vm.content"></textarea></p><p><button class="btn btn-success btn-block" ng-click="vm.convert(vm.content)">\u8f6c\u6362</button></p><p><button class="btn btn-block btn-default" ng-click="vm.isShowContent = !vm.isShowContent">\u663e\u793a\u9690\u85cf\u6587\u672c</button></p></div></div><div style="display: none"><pre>{{vm.items | json}}</pre></div>')}])}();